import React from 'react';
import './Profile.css';

const Profile = () => {
  return (
    <div className="profile">
      <h1>About Me</h1>
      <p>Hi, I'm Assem K. Welcome to my portfolio website.</p>
      <p>I am a software developer with experience in frontend and backend technologies.</p>
      <p>Feel free to browse through my projects and contact me if you have any questions.</p>
    </div>
  );
};

export default Profile;
